  }

  render() {
    return (
      <section className="tasks">
        <div className="tasks-header"></div>
        <div className="tasks-item"></div>
        <div className="tasks-item"></div>
        <div className="tasks-item"></div>
        <div className="tasks-item"></div>
        <div className="tasks-add">
          <img src={AddIcon} alt="" />
          <p>Новая задача</p>
        </div>
      </section>
    )
  }
}

export default Tasks;
